import { BrowserRouter, Route, Routes} from 'react-router-dom';
import {Link} from 'react-router-dom';
import User from './userRoute/user';
import React from 'react';


function App() {
  return (
    <div>
            <Link to="./userRoute/user">
                <button class="btn btn-primary btn-ghost">사용자</button>
            </Link>
            <button class="btn btn-primary btn-ghost">조회 기관</button>
            <button class="btn btn-primary btn-ghost">헌혈 기관</button>
       </div>
  );
}

export default App;
